import React, { Component } from 'react'
import Breadcrumbs from '@material-ui/core/Breadcrumbs';
import Link from '@material-ui/core/Link';
import Typography from '@material-ui/core/Typography';
import {withRouter} from 'react-router'

export class UsersPage extends Component {

    handleNav(data) {
        this.props.history.push(data)
    }

    render() {
        return(
            <div>
                <Typography color="subbtitle">Users</Typography>
                <Breadcrumbs aria-label="breadcrumb" style={{ fontSize: '13px' }}>
                    <Link color="inherit" onClick={() => this.props.history.push('/')} >
                        Home
                    </Link>
                    <Link color="inherit" href="/" >
                        Users
                    </Link>
                    <Typography style={{ fontSize: '13px' }} color="textPrimary">List Users</Typography>
                </Breadcrumbs>
            </div>
        );
    }
}

export default withRouter(UsersPage)
